import React from 'react';

function TODOList(){
    const [tasks, setTasks] = React.useState(["Nothing to do!"]);
    return(
        <div>
            <h1>ToDo List</h1>
            {tasks.map((task) =>{
                return <div key={task}>{task}</div>;
            })}
            <div class="container">
            <form role="form">

                <div class="row">
                    <div class="form-group col-lg-12 ">
                        <input style={{width:"auto"}} type="text" class="form-control input-normal" placeholder="insert task" />
                    </div>
                </div>
                <div class="row">
                    <button type="submit" class="btn btn-default">Submit</button>
                </div>
            </form>
</div>
        </div>  
    )
}

export default TODOList;
